if (request_expression === null) {
  return;
}

var newVendorParams = {};
if (request_expression !== null && request_expression.length > -1) {
  for (var i = 0; i < request_expression.length; i++) {
    var exp = request_expression[i];
    if (exp.operator === '=' && exp.attribute === 'system' && (exp.value === 'true' || exp.value === 'false')) {
      newVendorParams[exp.attribute] = exp.value;
    } else if (exp.operator === '=') {
      newVendorParams["Filter" + (i + 1)] = exp.attribute + " Is_equal_to " + exp.value;
    } else if (exp.operator === '<') {
      newVendorParams["Filter" + (i + 1)] = exp.attribute + " Is_less_than " + exp.value;
    } else if (exp.operator === '>') {
      newVendorParams["Filter" + (i + 1)] = exp.attribute + " Is_greater_than " + exp.value;
    } else if (exp.operator === '!=') {
      newVendorParams["Filter" + (i + 1)] = exp.attribute + " Is_not_equal_to " + exp.value;
    } else if (exp.operator === '!=' && (exp.value === 'null' || exp.value === 'NULL')) {
      newVendorParams["Filter" + (i + 1)] = exp.attribute + " Is_not_NULL ";
    } else if (exp.operator === 'Contains' || exp.operator === 'CONTAINS') {
      newVendorParams["Filter" + (i + 1)] = exp.attribute + " Contains " + exp.value;
    }
  }
}
return {
  "request_vendor_parameters": newVendorParams
}

var config_hash = JSON.parse(configuration["webhook.hash"]);
var id = request_path.split("/");
var form_id = id[4];
var webhook_hash = config_hash[form_id]; 

return{
	"request_vendor_path": '/forms/'+form_id+'/webhooks/'+webhook_hash+'.json'
}

var id = request_vendor_url.split("/");
id = id[6];
var webhookHash = {};
var hash_config = {};
var config = {};

if (configuration["webhook.hash" ] === null || configuration["webhook.hash" ] === '' || Object.keys(JSON.parse(configuration["webhook.hash"])).length === 0){
	webhookHash[id] = response_body["WebHookPutResult"]["Hash"];
} else {
	hash_config = JSON.parse(configuration["webhook.hash"]);
	hash_config[id] = response_body["WebHookPutResult"]["Hash"];
	webhookHash = hash_config;
}
config = {
	"webhook.hash" : JSON.stringify(webhookHash)
};
return {
  "configuration": config
}

